import React from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminPanel.css';

const AdminPanel = () => {
    const navigate = useNavigate();

    const handleManageProducts = () => {
        navigate('/manage-products');
    };

    const handleManageVendors = () => {
        navigate('/manage-vendors');
    };

    const handleDeleteProducts = () => {
        navigate('/delete-products');
    };

    const handleDeleteUsers = () => {
        navigate('/delete-users');
    };

    return (
        <>
            <div className="header">
                <h1 className="logo">
                    Flex<span className="white-text">Fuels</span>
                </h1>
                <p className="tagline">...a one-stop solution for optimum nutrition</p>
            </div>

            <div className="admin-container">
                <h2 className="admin-title">Admin Panel</h2>

                <div className="admin-actions">
                    <button onClick={handleManageProducts} className="admin-button manage-products-button">
                        Manage Products
                    </button>
                    <button onClick={handleManageVendors} className="admin-button manage-vendors-button">
                        Manage Vendors
                    </button>
                    <button onClick={handleDeleteProducts} className="admin-button delete-products-button">
                        Delete Products
                    </button>
                    <button onClick={handleDeleteUsers} className="admin-button delete-users-button">
                        Delete Users
                    </button>
                </div>
            </div>
        </>
    );
};

export default AdminPanel;
